import Signup from './Signup'

class HomePage extends Component {
    constructor() {
        super(),
            this.state = {
                number: 0
            }
    }

    handleRe = () => {
        this.setState({ number: 3 })
    }

    render() {
        return (
            <div>
                <div onClick={this.handleRe}>signup</div>
            </div>
        )
    }
}

export default HomePage
